import collections
class Solution:
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        a_set = set(s)
        b_set = set(t)
        if a_set != b_set:
            return ("".join(b_set - a_set))
        else:
            t_dic = collections.Counter(t)
            s_dic = collections.Counter(s)
            for i in t_dic.keys():
                if t_dic[i] != s_dic[i]:
                    return i

    def findTheDifference1(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        ch = 'qwertyuiopasdfghjklzxcvbnm'
        for x in ch:
            if len(s.split(x)) != len(t.split(x)):
                return x


